package main

import (
	"strconv"
	"strings"
)

func aizuArray(str string) []int {
	arr := strings.Split(str, ",")
	b := make([]int, len(arr))
	for i, v := range arr {
		b[i], _ = strconv.Atoi(v)
	}
	return b
}

